-- ============================================
-- Ella Rises Database - PostgreSQL Script
-- Generated from normalized data (3NF with IDs)
-- snake_case naming convention
-- ============================================

-- Drop tables in reverse dependency order
DROP TABLE IF EXISTS donation CASCADE;
DROP TABLE IF EXISTS milestone CASCADE;
DROP TABLE IF EXISTS registration CASCADE;
DROP TABLE IF EXISTS event_occurrence CASCADE;
DROP TABLE IF EXISTS event CASCADE;
DROP TABLE IF EXISTS nps CASCADE;
DROP TABLE IF EXISTS person CASCADE;

-- ============================================
-- CREATE TABLES
-- ============================================

-- person table (surrogate key)
CREATE TABLE person (
    person_id SERIAL PRIMARY KEY,
    email VARCHAR(255) UNIQUE NOT NULL,
    first_name VARCHAR(100),
    last_name VARCHAR(100),
    dob DATE,
    role VARCHAR(50),
    phone VARCHAR(20),
    city VARCHAR(100),
    state VARCHAR(10),
    zip VARCHAR(20),
    school_or_employer VARCHAR(255),
    field_of_interest VARCHAR(50)
);

-- event table (surrogate key)
CREATE TABLE event (
    event_id SERIAL PRIMARY KEY,
    event_name VARCHAR(255) UNIQUE NOT NULL,
    event_type VARCHAR(100),
    event_description TEXT,
    event_recurrence_pattern VARCHAR(50),
    event_default_capacity INTEGER
);

-- nps lookup table (natural key) - scores 1-5
CREATE TABLE nps (
    survey_recommendation_score DECIMAL(3,1) PRIMARY KEY,
    survey_nps_bucket VARCHAR(50)
);

-- event_occurrence table (surrogate key)
CREATE TABLE event_occurrence (
    event_occurrence_id SERIAL PRIMARY KEY,
    event_id INTEGER NOT NULL REFERENCES event(event_id),
    event_datetime_start TIMESTAMP,
    event_datetime_end TIMESTAMP,
    event_location VARCHAR(255),
    event_capacity INTEGER,
    event_registration_deadline TIMESTAMP
);

-- registration table (composite key: person_id + event_occurrence_id)
CREATE TABLE registration (
    person_id INTEGER NOT NULL REFERENCES person(person_id),
    event_occurrence_id INTEGER NOT NULL REFERENCES event_occurrence(event_occurrence_id),
    registration_status VARCHAR(50),
    registration_attended_flag BOOLEAN,
    registration_check_in_time TIMESTAMP,
    registration_created_at TIMESTAMP,
    survey_satisfaction_score DECIMAL(3,1),
    survey_usefulness_score DECIMAL(3,1),
    survey_instructor_score DECIMAL(3,1),
    survey_recommendation_score DECIMAL(3,1),
    survey_overall_score DECIMAL(4,2),
    survey_comments TEXT,
    survey_submission_date TIMESTAMP,
    PRIMARY KEY (person_id, event_occurrence_id)
);

-- milestone table (composite key: person_id + milestone_no)
CREATE TABLE milestone (
    person_id INTEGER NOT NULL REFERENCES person(person_id),
    milestone_no INTEGER NOT NULL,
    milestone_title VARCHAR(255),
    milestone_date DATE,
    PRIMARY KEY (person_id, milestone_no)
);

-- donation table (surrogate key)
CREATE TABLE donation (
    donation_id SERIAL PRIMARY KEY,
    person_id INTEGER NOT NULL REFERENCES person(person_id),
    donation_date VARCHAR(50),
    donation_amount DECIMAL(10,2)
);

-- ============================================
-- CREATE INDEXES FOR PERFORMANCE
-- ============================================
CREATE INDEX idx_person_email ON person(email);
CREATE INDEX idx_event_occurrence_event_id ON event_occurrence(event_id);
CREATE INDEX idx_event_occurrence_start ON event_occurrence(event_datetime_start);
CREATE INDEX idx_registration_person_id ON registration(person_id);
CREATE INDEX idx_registration_occurrence_id ON registration(event_occurrence_id);
CREATE INDEX idx_milestone_person_id ON milestone(person_id);
CREATE INDEX idx_donation_person_id ON donation(person_id);

